import React, { Component }  from 'react';
import ReactDOM from 'react-dom';

class App extends Component{
    constructor(props){
        super(props);
        this.state = { entries:['Hi', 'Great', 'keep it up'], };
    }

    render(){
        return(
            <div>
                <ul>
                    <li>return this.entries.map((start, counter) => {
                        this.state.entries[start]
                    }
                     </li>
                </ul>                
            </div>
        )
    }
}

ReactDOM.render(
    <App />,
    document.querySelector('#root')
);
